import {Canvas} from '@react-three/fiber'
import './styles.css'
import './Model.js'
import Side1 from './Side1.js';
import CenterClip from './CenterClip.js';
import Side2 from './Side2.js';
import { Suspense } from 'react'
import { Html,OrbitControls} from '@react-three/drei'
import { Light } from 'three';
import Button from '@mui/material/Button';
import Bottom_Plate_3_Inch from './Bottom_Plate_3_Inch.js';
import Body from './Body.js';
import logo from './pngfind.com-drone-icon-png-6764602.png';
import controllerlogo from './controllerupgrade.png';
import {BearCounter,Controls} from './bearcounter.js';
import {useStore} from './bearcounter'
import Header from './header'
const HTMLOutside = () => {
  return(
      <div className='all'>
          <div className='header'>
          <img className='headerimg' src={controllerlogo}/>
          <h1 className='headertitle'>QUADBOX CUSTOMS</h1>
    </div>
          <div className='body'>
              <h2 className='motto'>
                  CUSTOMIZATION UNDER YOUR CONTROL
              </h2>
          </div>
    </div>

  )

};

const HTMLInside = () => {
  return(
    <Html fullscreen>
      <div className='container'>
        <h1 className='title'>Inside Canvas</h1>
      </div>
    </Html>
  );
}
const Scene = () => {
  return(
    <Canvas colorManagement camera={{position: [0,-100,-100],fov:70}}>
      <Suspense fallback={null}>
          <ambientLight intensity={0.5}/>
     <pointLight intensity={1.15} position={[0, 24, -100]} />
          <OrbitControls/>
          <CenterClip position={[100,50,100]}/>
          <Side1/>
          <Side2/>
      </Suspense>

   /
    </Canvas> 
  );
}

function App() {
  return(
    <>
        <HTMLOutside/>  
        <Scene />
        <Body/>
        <BearCounter/>
        <Controls/>
    </>
  );
};
require('react-dom');
window.React2 = require('react');
export default App;
